    data: |
      SELECT DISTINCT - 56 AS col2, CASE + 45 WHEN + - 21 THEN + COUNT ( * ) * 28 + + - COUNT ( * ) - + + ( - CAST ( + - 10 AS INTEGER ) ) WHEN + 60 / COUNT ( * ) + MAX ( 95 ) THEN + COUNT ( * ) ELSE + 59 END AS col1;

outputs:
  - name: q2195.out
    data: |
      -56	59
